        <script>
        (function(){
          function bump(){
            var note = document.getElementById('map-note');
            var ctrlWrap = document.querySelector('.leaflet-top.leaflet-right');
            if(!note || !ctrlWrap) return;
            var h = note.getBoundingClientRect().height;
            ctrlWrap.style.marginTop = (h + 12) + 'px'; // 12px de respiro
          }
          // 1) ao carregar
          window.addEventListener('load', bump);
          // 2) ao redimensionar
          window.addEventListener('resize', bump);
          // 3) quando imagens da nota terminarem de carregar
          document.querySelectorAll('#map-note img').forEach(function(img){
            if(img.complete) return; img.addEventListener('load', bump);
          });
          // 4) pequena chamada tardia para garantir
          setTimeout(bump, 300);
        })();
        </script>
